import React, {FC} from 'react'

interface ButtonProps {
    disabled?: boolean;
    href?: string;
    onClick: React.MouseEventHandler<HTMLButtonElement | HTMLAnchorElement>;
    styling?: Object;
    children?: React.ReactNode;
    target?: string;
};

const Button: React.FunctionComponent<ButtonProps> = ({
    disabled = false,
    href,
    onClick,
    styling,
    children,
    target
}) => {
    return href ? (
        <Link href={href} onClick={onClick} styling={styling} children={children} disabled={disabled}/>
    ) : (
        <button
            disabled={disabled}
            onClick={onClick}
            style={styling}
        >
            {children}
        </button>
    )
}

const Link: React.FunctionComponent<ButtonProps> = ({
    href,
    children,
    onClick,
    styling,
    disabled
}) => {
    return (
        <a href={href} onClick={onClick} style={styling}>
            {children}
        </a>
    )
}

export default Button;
